    public function yb2yb($val){

        foreach($this->yb as $k => $v){
            foreach($v as $kv){
                if(strpos($val,$kv) !== false){
                    $val = str_replace($kv,$k,$val);
                }               
            }
        }
        return $val;
    }
    /**
     * 汉字转拼音函数（取每个汉字的首字母）
     * @param string $string
     * @return string
     */
    public function str2py($string)
    {
        $string = preg_replace("/\s/is", "_", $string);
        $string = preg_replace("/(|\~|\_|\`|\!|\@|\#|\$|\%|\^|\&|\*|\(|\)|\-|\+|\=|\{|\}|\[|\]|\||\\|\:|\;|\"|\'|\<|\,|\>|\.|\?|\/)/is", "", $string);
        $py = "";
        // $string = iconv('UTF-8', 'GBK', $string);
        $string = mb_convert_encoding($string,"GBK","UTF-8");
        for ($i = 0; $i < strlen($string); $i++) {
            if (ord($string[$i]) > 128) {
                $char = $this->asi2py(ord($string[$i]) + ord($string[$i + 1]) * 256);
                $py .= $char[0];//取拼音的第一个字符
//                break;
                $i++;
            } else {
                $py .= $string[$i];
            }
        }
        return strtolower($py);
    }
 
    /**
     * 汉字转拼音函数（取每个汉字的全部字母）
     * @param string $string
     * @return string
     */
    public function str2pys($string)
    {
        $string = preg_replace("/\s/is", "_", $string);
        $string = preg_replace("/(|\~|\_|\`|\!|\@|\#|\$|\%|\^|\&|\*|\(|\)|\-|\+|\=|\{|\}|\[|\]|\||\\|\:|\;|\"|\'|\<|\,|\>|\.|\?|\/)/is", "", $string);
        $py = "";
        // $string = iconv('UTF-8', 'GBK', $string);
        $string = mb_convert_encoding($string,"GBK","UTF-8");
        for ($i = 0; $i < strlen($string); $i++) {
            if (ord($string[$i]) > 128) {
                $char = $this->asi2py(ord($string[$i]) + ord($string[$i + 1]) * 256);
                $py .= "\t".$char;//取拼音的全部字符
                $i++;
            } else {
                $py .= "\t".$string[$i];
            }
        }
        return strtolower($py);
    }
 
